import React from "react";
import './experience.css'; 

const ExperienceCard = ({jobTitle, dates, jobDescription, }) => {
    return (
        <div className="job">
            <div className="jobInfo">
                <h5>{jobTitle}</h5>
                <p>{dates}</p>
            </div>
            <p>{jobDescription}</p>
        </div>
    )
}

export default ExperienceCard;
